const RecordTime = ({ pressingTime }) => {
    if(!pressingTime) {
        return (
            <div className="ui statistic">
                <div className="value">
                    08:53 AM
                </div>
                <div className="label">
                    Signed In!
                </div>
            </div>
        );
    } else {
        return (
            <div className="ui statistic">
                <div className="value">
                    { pressingTime }
                </div>
                <div className="label">
                    Signed Out!
                </div>
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        pressingTime: state.pressingTime
    };
}

export default connect(mapStateToProps)(RecordTime);
